import React from 'react';
import { useNavigate } from 'react-router-dom';

function NavigationBar({ onConfirm, onDelete }) {
    const navigate = useNavigate();

    return (
        <div className="navbar">
            <div className="logo" onClick={() => navigate('/')}>
                HeartViz
            </div>
            <div className="nav-actions">
                <button className="nav-button confirm-button" onClick={onConfirm}>
                    Confirm
                </button>
                <button className="nav-button delete-button" onClick={onDelete}>
                    Delete
                </button>
            </div>
        </div>
    );
}

export default NavigationBar;
